"use strict";(self.webpackChunkdocs_inteli_blockchain=self.webpackChunkdocs_inteli_blockchain||[]).push([[2308],{4903:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"fourth-post","metadata":{"permalink":"/docs3/blog/fourth-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-08-09-fourth-post/index.md","source":"@site/blog/2025-08-09-fourth-post/index.md","title":"Lan\xe7amento Do Site","description":"Salve, comunidade! Aqui \xe9 o CryptoVictor e \xe9 oficial: o Inteli Blockchain agora tem um site pr\xf3prio! Eu sei, \xe0 primeira vista isso pode parecer s\xf3 mais um projeto de faculdade, mas a real \xe9 que isso representa muito mais. \xc9 um marco ver como o clube tem evolu\xeddo. Temos um blog, um site, realizamos in\xfameros eventos \u2014 e tem muito mais vindo por a\xed... A comunidade nunca esteve t\xe3o viva.","date":"2025-08-09T00:00:00.000Z","tags":[{"inline":false,"label":"Web3","permalink":"/docs3/blog/tags/web3","description":"Web3 tag description"}],"readingTime":1.36,"hasTruncateMarker":false,"authors":[{"name":"Victor Garcia dos Santos","title":"Computer Scientist and Blockchain Engineer","url":"mailto:gds.victor09@gmail.com","page":{"permalink":"/docs3/blog/authors/cryptovictor"},"socials":{"x":"https://x.com/CryptoV1ct0r","linkedin":"https://www.linkedin.com/in/victor-garcia-dos-santos/","github":"https://github.com/CryptoVictor"},"imageURL":"https://avatars.githubusercontent.com/u/89162257","key":"cryptovictor"}],"frontMatter":{"slug":"fourth-post","title":"Lan\xe7amento Do Site","authors":["cryptovictor"],"tags":["web3"]},"unlisted":false,"nextItem":{"title":"Believe in Som\u039eTHing","permalink":"/docs3/blog/third-post"}},"content":"Salve, comunidade! Aqui \xe9 o CryptoVictor e \xe9 oficial: o Inteli Blockchain agora tem um site pr\xf3prio! Eu sei, \xe0 primeira vista isso pode parecer s\xf3 mais um projeto de faculdade, mas a real \xe9 que isso representa muito mais. \xc9 um marco ver como o clube tem evolu\xeddo. Temos um blog, um site, realizamos in\xfameros eventos \u2014 e tem muito mais vindo por a\xed... A comunidade nunca esteve t\xe3o viva.\\n\\n![Imagem do site](./site.png)\\n\\nComo membro, n\xe3o tenho como n\xe3o comemorar. Ver at\xe9 onde chegamos \xe9 uma vit\xf3ria. E o mais empolgante: isso \xe9 s\xf3 o come\xe7o. V\xeam a\xed muitos outros projetos incr\xedveis \u2014 e mal posso esperar para compartilhar cada um deles com voc\xeas.\\n\\nO Inteli Blockchain pode at\xe9 ter nascido como um clube de hackathon dentro do Inteli, mas hoje \xe9 muito mais do que isso. \xc9 realmente uma comunidade, sabe?\\n\\nLembro bem da minha fase l\xe1 em 2021, no quarto, sozinho, curioso, estudando Web3 e blockchain, sonhando com o dia em que eu pudesse viver tudo isso com outras pessoas que compartilhassem a mesma paix\xe3o. E hoje, isso \xe9 real.\\n\\nEste post \xe9 mais do que um an\xfancio do site. \xc9 tamb\xe9m um agradecimento.  \\nObrigado, Inteli. Obrigado a cada pessoa do Inteli Blockchain que vive, aprende, erra e cresce junto nesse universo.  \\nA gente fala sobre liberdade, tecnologia, futuro \u2014 e isso muda a vida de cada membro, inclusive a minha.\\n\\nEnt\xe3o \xe9 isso. Um sincero obrigado a todos \u2014 e n\xe3o deixem de conferir o site [[**LINK DO SITE AQUI**](https://www.inteliblockchain.org/)]. T\xe1 ficando bem legal mesmo.\\n\\n> A gente se v\xea no pr\xf3ximo bloco.\\n\\n---\\n\\n*CryptoVictor, out.*  \\n\\n![Imagem do Inteli Blockchain](./inteliblockchain.webp)"},{"id":"third-post","metadata":{"permalink":"/docs3/blog/third-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-07-29-third-post/index.md","source":"@site/blog/2025-07-29-third-post/index.md","title":"Believe in Som\u039eTHing","description":"Fala pessoal, tudo certo?","date":"2025-07-29T00:00:00.000Z","tags":[{"inline":false,"label":"Web3","permalink":"/docs3/blog/tags/web3","description":"Web3 tag description"}],"readingTime":2.11,"hasTruncateMarker":false,"authors":[{"name":"Victor Garcia dos Santos","title":"Computer Scientist and Blockchain Engineer","url":"mailto:gds.victor09@gmail.com","page":{"permalink":"/docs3/blog/authors/cryptovictor"},"socials":{"x":"https://x.com/CryptoV1ct0r","linkedin":"https://www.linkedin.com/in/victor-garcia-dos-santos/","github":"https://github.com/CryptoVictor"},"imageURL":"https://avatars.githubusercontent.com/u/89162257","key":"cryptovictor"}],"frontMatter":{"slug":"third-post","title":"Believe in Som\u039eTHing","authors":["cryptovictor"],"tags":["web3"]},"unlisted":false,"prevItem":{"title":"Lan\xe7amento Do Site","permalink":"/docs3/blog/fourth-post"},"nextItem":{"title":"Tend\xeancias da Web3 em 2025","permalink":"/docs3/blog/second-post"}},"content":"**Fala pessoal, tudo certo?**  \\n*CryptoVictor* aqui, e hoje o papo \xe9 especial demais: o **Ethereum completa 10 anos** neste 30 de julho de 2025.  \\nE n\xe3o \xe9 s\xf3 o anivers\xe1rio de uma blockchain \u2014 \xe9 um momento hist\xf3rico pra toda uma comunidade global.\\n\\n---\\n\\n![Ethereum 10 anos](./ethereum10years.webp)\\n\\n---\\n\\n## De rede a movimento global\\n\\nQuando o Ethereum nasceu, l\xe1 em 2015, **nada do que temos hoje existia**. Termos como *Web3*, *Layer 2*, *DAOs*, *dApps* e *smart contracts* simplesmente **n\xe3o faziam parte do vocabul\xe1rio**.\\n\\nHoje, essas palavras moldam um novo mundo digital.  \\nO Ethereum n\xe3o foi s\xf3 uma nova blockchain \u2014 ele foi o **ber\xe7o de um ecossistema** inteiro que continua crescendo a cada fork, upgrade, e comunidade criada.\\n\\n---\\n\\n## Uma rede que respira\\n\\nAlgo importante a se lembrar \xe9 como o Ethereum evoluiu **absurdamente** nesses 10 anos:\\n\\n- Superou o **DAO Attack** e se reinventou com o hard fork.\\n- Mudou sua base com o **The Merge**, saindo do *Proof of Work* para o *Proof of Stake*.\\n- Incentivou a cria\xe7\xe3o de **Layer 2s** como Optimism, Arbitrum, Base e zkSync.\\n- Ajudou a consolidar uma cultura pr\xf3pria com os **ETHGlobals**, hackathons, eventos e devs no mundo todo.\\n\\nTudo isso mostra que o Ethereum **n\xe3o \xe9 s\xf3 c\xf3digo. \xc9 comunidade viva**. \xc9 o Infinite Garden crescendo.\\n\\n---\\n\\n## A blockchain do mundo\\n\\n\xc9 verdade que n\xe3o sabemos o que o futuro reserva.  \\nTalvez a Solana escale ainda mais. Talvez a Cardano entregue tudo o que prometeu.  \\n\\nMas tamb\xe9m \xe9 verdade que o Ethereum **nunca caiu**.  \\nEle resistiu a ataques, cr\xedticas, falhas e promessas de blockchains \u201cmelhores\u201d.  \\nHoje, ele segue firme como **a blockchain do mundo** \u2014 viva, resiliente e em constante evolu\xe7\xe3o.\\n\\n---\\n\\n## O come\xe7o\\n\\nParece piada, mas tudo come\xe7ou com um jogo.  \\n**Vitalik Buterin**, ainda adolescente, jogava *World of Warcraft* e ficou inconformado com a centraliza\xe7\xe3o.  \\nAnos depois, ele criou o Ethereum \u2014 e o resto \xe9 hist\xf3ria.\\n\\nPra mim, isso n\xe3o \xe9 s\xf3 inspirador. \xc9 **transformador**, como algo t\xe3o simples para alguns, o motivou a fazer algo t\xe3o grande.\\n\\n---\\n\\n## Minha homenagem como builder\\n\\nEssa \xe9 a minha homenagem, como *CryptoVictor* e membro do **Inteli Blockchain**, pra rede que **mudou minha vida**.\\n\\nO Ethereum n\xe3o foi s\xf3 uma tecnologia. Foi **o come\xe7o de um novo mundo** pra mim \u2014 onde pude criar, participar de hackathons, viajar, aprender, conhecer pessoas incr\xedveis e sonhar mais alto.\\n\\n---\\n\\n## \ud83c\udf82 Feliz anivers\xe1rio, Ethereum!\\n\\nObrigado Ethereum.  \\nObrigado Ethereum Foundation.  \\n\\nDe \u201cirm\xe3 mais nova do Bitcoin\u201d ao **ponto de partida de uma revolu\xe7\xe3o digital**, o Ethereum est\xe1 s\xf3 come\xe7ando.\\n\\n> **Believe in som\u039eTHing.**  \\n> Porque acreditar em algo muda tudo.\\n\\n---\\n\\n*CryptoVictor, out.*  \\n\\n![Vitalik Buterin e Cryptovictor](./ethereum.webp)"},{"id":"second-post","metadata":{"permalink":"/docs3/blog/second-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-07-22-second-post/index.md","source":"@site/blog/2025-07-22-second-post/index.md","title":"Tend\xeancias da Web3 em 2025","description":"Opa galera, e a\xed!","date":"2025-07-22T00:00:00.000Z","tags":[{"inline":false,"label":"Web3","permalink":"/docs3/blog/tags/web3","description":"Web3 tag description"}],"readingTime":3.63,"hasTruncateMarker":false,"authors":[{"name":"Victor Garcia dos Santos","title":"Computer Scientist and Blockchain Engineer","url":"mailto:gds.victor09@gmail.com","page":{"permalink":"/docs3/blog/authors/cryptovictor"},"socials":{"x":"https://x.com/CryptoV1ct0r","linkedin":"https://www.linkedin.com/in/victor-garcia-dos-santos/","github":"https://github.com/CryptoVictor"},"imageURL":"https://avatars.githubusercontent.com/u/89162257","key":"cryptovictor"}],"frontMatter":{"slug":"second-post","title":"Tend\xeancias da Web3 em 2025","authors":["cryptovictor"],"tags":["web3"]},"unlisted":false,"prevItem":{"title":"Believe in Som\u039eTHing","permalink":"/docs3/blog/third-post"},"nextItem":{"title":"High Block","permalink":"/docs3/blog/first-project"}},"content":"**Opa galera, e a\xed!**  \\nAqui \xe9 o *CryptoVictor* e hoje vamos conversar sobre o que eu vejo como as principais tend\xeancias que a Web3 est\xe1 seguindo em 2025. Falo isso baseado no que vi da comunidade mesmo ao longo deste ano \u2014 e isso inclui diferentes esferas da Web3: a EVM, Solana, tecnologias como Chainlink, e at\xe9 a galera da esfera bitcoiner.\\n\\nTive o privil\xe9gio de participar de v\xe1rios eventos gigantes de cripto em 2025, como **ETHGlobal Cannes**, **Chiliz Paris**, **Casa21**, **MetaMask Builders Night**, **Modular Carnival**, **Vega House**, entre muitos outros \u2014 e em todos eles percebi que a comunidade est\xe1 bem focada em alguns pontos bem espec\xedficos.\\n\\n---\\n\\n## IA em Web3\\n\\nO primeiro ponto \u2014 e talvez o mais falado \u2014 \xe9 sobre **IA**, a tecnologia do momento. Vejo que *IA na Web3* \xe9 o assunto mais discutido hoje em dia. Startups pipocam a cada canto, principalmente agora com a explos\xe3o dos **Agentes Aut\xf4nomos** (tipo AutoGPTs descentralizados, conectando dApps, carteiras e or\xe1culos de forma automatizada).\\n\\nE essa \xe9, na real, uma das tecnologias que mais **faz sentido junto da Web3**: dados s\xe3o a base da IA, e Web3 tem como princ\xedpio a soberania sobre os pr\xf3prios dados. Sem falar da quest\xe3o da identidade digital e da privacidade, que voltaram com tudo.\\n\\nTive conversas bem massa com nomes grandes de IA no ETHCannes, e muitos deles citaram o potencial de projetos como a **Worldcoin** (pol\xeamico e esquisito, mas com uma proposta bem interessante), que j\xe1 d\xe1 uma amostra do uso pr\xe1tico de identidade global integrada com IA e blockchain.\\n\\n<center>\\n![Worldcoin](./worldcoin.png)\\n</center>\\n\\n---\\n\\n## RWAs e Or\xe1culos\\n\\nAgora, saindo um pouco das tecnologias hypadas, bora falar de um **\\"cavalo velho\\"** da Web3 que continua firme: os **RWAs (Real World Assets)**.\\n\\nRWAs basicamente s\xe3o ativos do mundo real tokenizados na blockchain \u2014 e isso inclui im\xf3veis, a\xe7\xf5es, t\xedtulos, commodities, entre outros. Muita gente fala que esse pode ser o **maior caso de uso da economia descentralizada**.\\n\\nS\xf3 que\u2026 ainda n\xe3o rolou o boom. A **quest\xe3o regulat\xf3ria** continua sendo o grande gargalo. Nenhum projeto realmente escalou globalmente ainda \u2014 embora no Brasil a gente j\xe1 veja algumas iniciativas legais, nada concreto realmente foi feito.\\n\\nUm ponto importante \xe9 que nesta tecnologia o papel dos **or\xe1culos**, principalmente a **Chainlink**, \xe9 essencial aqui. \xc9 ela quem conecta dados reais a blockchain de forma segura e ver os recentes lan\xe7amentos dela como o **CCIP (Cross-Chain Interoperability Protocol)**, animou bastante quem v\xea os RWAs como o futuro.\\n\\n![Chainlink](./chainlink.png)\\n\\n---\\n\\n## Criptografia e Privacidade\\n\\nVoc\xea pode estar se perguntando: *\u201cU\xe9, privacidade e criptografia como tend\xeancia? Isso j\xe1 n\xe3o \xe9 uma das bases da Web3, CryptoVictor?\u201d*\\n\\nE eu te digo: **sim, \xe9 base**, mas estamos entrando numa nova fase disso.  \\nN\xe3o \xe9 s\xf3 **ZK (Zero-Knowledge)** \u2014 que, ali\xe1s, continua evoluindo com for\xe7a \u2014, mas tamb\xe9m **solu\xe7\xf5es novas em L2**, **abstra\xe7\xe3o de contas (Account Abstraction)**, e a galera j\xe1 preocupada com **criptografia p\xf3s-qu\xe2ntica**, mesmo sem um problema imediato.\\n\\nA quantidade de solu\xe7\xf5es de privacidade que surgiram em 2024 e agora em 2025 \xe9 absurda. Protocolos como **Railgun**, **Aztec**, e as melhorias nas **bridges** mostram como o ecossistema est\xe1 finalmente conseguindo equilibrar seguran\xe7a e usabilidade.\\n\\nAt\xe9 mesmo os bitcoiners, que historicamente eram contra mudan\xe7as na base do protocolo, est\xe3o explorando novos recursos via **Ordinals**, **Covenants** e **BitVM**.\\n\\n---\\n\\n## Uma nota sobre maturidade\\n\\nHoje a Web3 parece mais madura. J\xe1 n\xe3o vemos tantos projetos lan\xe7ando tokens s\xf3 por lan\xe7ar, nem promessas milagrosas de 1000x em uma semana (apesar de isso ainda existir e sempre existir). A diferen\xe7a \xe9 que **as solu\xe7\xf5es reais est\xe3o se sobressaindo**.\\n\\nD\xe1 pra perceber isso at\xe9 na linguagem dos investidores e builders nos eventos: \xe9 tudo mais t\xe9cnico, mais p\xe9 no ch\xe3o, mais s\xe9rio.\\n\\n---\\n\\n## Conclus\xe3o\\n\\nA real \xe9 que a Web3 **n\xe3o para**. E pra mim, o *boom* desse universo est\xe1 s\xf3 come\xe7ando.  \\nSim, o mercado est\xe1 mais cauteloso, mas tamb\xe9m **mais preparado**. As barreiras regulat\xf3rias est\xe3o caindo aos poucos, e cada vez mais vemos solu\xe7\xf5es reais e com impacto direto nas pessoas.\\n\\nSem falar na pr\xf3pria **alta do Bitcoin** recente, que trouxe de volta os olhares do mercado tradicional. Mas dessa vez, com mais estrutura, mais casos de uso, e uma comunidade global ainda mais forte.\\n\\nSeguimos construindo, aprendendo e acelerando.\\nA Web3 t\xe1 s\xf3 come\xe7ando a mostrar do que \xe9 capaz.\\n\xc9 s\xf3 o come\xe7o da pr\xf3xima revolu\xe7\xe3o digital \u2014 e o topo j\xe1 t\xe1 logo ali. \ud83d\ude80\\n\\n*CryptoVictor, out.*\\n\\n![Evento](./foto.jpg)"},{"id":"first-project","metadata":{"permalink":"/docs3/blog/first-project","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-06-09-first-project/index.md","source":"@site/blog/2025-06-09-first-project/index.md","title":"High Block","description":"\ud83d\ude80 O In\xedcio de uma Nova Era no Inteli Blockchain","date":"2025-06-09T00:00:00.000Z","tags":[{"inline":false,"label":"Web3","permalink":"/docs3/blog/tags/web3","description":"Web3 tag description"},{"inline":false,"label":"Blockchain Basics","permalink":"/docs3/blog/tags/blockchain-basics","description":"Blockchain Basics tag description"}],"readingTime":0.72,"hasTruncateMarker":false,"authors":[{"name":"Victor Garcia dos Santos","title":"Computer Scientist and Blockchain Engineer","url":"mailto:gds.victor09@gmail.com","page":{"permalink":"/docs3/blog/authors/cryptovictor"},"socials":{"x":"https://x.com/CryptoV1ct0r","linkedin":"https://www.linkedin.com/in/victor-garcia-dos-santos/","github":"https://github.com/CryptoVictor"},"imageURL":"https://avatars.githubusercontent.com/u/89162257","key":"cryptovictor"},{"name":"Maria Arielly Lima de Oliveira","title":"Software Engineer","url":"mailto:maria.lima@sou.inteli.edu.br","page":{"permalink":"/docs3/blog/authors/arielly"},"socials":{"linkedin":"https://www.linkedin.com/in/maria-arielly/","github":"https://github.com/arielly-lima"},"imageURL":"https://avatars.githubusercontent.com/u/194326849","key":"arielly"},{"name":"Francisco de Araujo Ferreira Filho","title":"Software Engineer","url":"mailto:francisco.filho@sou.inteli.edu.br","page":{"permalink":"/docs3/blog/authors/francisco"},"socials":{"github":"https://github.com/fr4ncisco7"},"imageURL":"https://avatars.githubusercontent.com/u/194029848","key":"francisco"}],"frontMatter":{"slug":"first-project","title":"High Block","authors":["cryptovictor","arielly","francisco"],"tags":["web3","blockchain-basics"],"date":"2025-06-09T00:00:00.000Z"},"unlisted":false,"prevItem":{"title":"Tend\xeancias da Web3 em 2025","permalink":"/docs3/blog/second-post"},"nextItem":{"title":"Primeira vers\xe3o da documenta\xe7\xe3o","permalink":"/docs3/blog/first-post"}},"content":"\ud83d\ude80 **O In\xedcio de uma Nova Era no Inteli Blockchain**\\n\\nO **primeiro projeto oficial** (High Block) do Inteli Blockchain \u2014 um passo fundamental para quem deseja entrar no mundo da Web3 com o p\xe9 direito.\\n\\nVamos construir **juntos** uma DApp completa, do zero ao deployment, explorando todas as camadas de desenvolvimento:\\n\\n- Cria\xe7\xe3o de uma **wallet**\\n- Desenvolvimento de **smart contracts**\\n- Backend em Web3\\n- Frontend funcional\\n- **Testes com Foundry**\\n- Integra\xe7\xe3o e boas pr\xe1ticas\\n\\nA ideia \xe9 **ensinar criando**, para que qualquer membro \u2014 independentemente do seu n\xedvel atual \u2014 consiga participar, aprender e entregar algo concreto. Este ser\xe1 o **legado t\xe9cnico e colaborativo** que queremos passar para as futuras gera\xe7\xf5es do Inteli Blockchain.\\n\\n\ud83e\uddf1 Este projeto \xe9 apenas o come\xe7o. Queremos que este post e esta iniciativa ecoem por muitos e muitos ciclos dentro do Inteli. Que seja refer\xeancia, ponto de partida e inspira\xe7\xe3o.\\n\\n**\\"Running Bitcoin!\\"** \u2013 Hall Finney\\n\\n![Blockchain](./blockchain.jpeg)"},{"id":"first-post","metadata":{"permalink":"/docs3/blog/first-post","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-06-08-first-version/index.md","source":"@site/blog/2025-06-08-first-version/index.md","title":"Primeira vers\xe3o da documenta\xe7\xe3o","description":"Esse post marca o in\xedcio da documenta\xe7\xe3o oficial do Inteli Blockchain.","date":"2025-06-08T00:00:00.000Z","tags":[{"inline":false,"label":"Web3","permalink":"/docs3/blog/tags/web3","description":"Web3 tag description"},{"inline":false,"label":"Blockchain Basics","permalink":"/docs3/blog/tags/blockchain-basics","description":"Blockchain Basics tag description"}],"readingTime":0.38,"hasTruncateMarker":false,"authors":[{"name":"Vinicius Testa Passos","title":"President at Inteli Blockchain (2025), Computer Scientist, and Blockchain Engineer","url":"mailto:viniciustestapassos@gmail.com","page":{"permalink":"/docs3/blog/authors/testa"},"socials":{"x":"https://x.com/viniciustestap1","linkedin":"https://www.linkedin.com/in/vinicius-testa-passos/","github":"https://github.com/VinTesta"},"imageURL":"https://avatars.githubusercontent.com/u/70596205","key":"testa"}],"frontMatter":{"slug":"first-post","title":"Primeira vers\xe3o da documenta\xe7\xe3o","authors":["testa"],"tags":["web3","blockchain-basics"]},"unlisted":false,"prevItem":{"title":"High Block","permalink":"/docs3/blog/first-project"}},"content":"Esse post marca o in\xedcio da documenta\xe7\xe3o oficial do Inteli Blockchain.\\n\\n\xc9 tamb\xe9m para eu dizer que estou muito ansioso para o que vamos contruir juntos nesse ano e nos que vem a seguir. Espero que esse legado seja levado a diante e que possamos contribuir ainda mais para a comunidade Web3 como um todo.\\n\\n\\"A mente que se abre a uma nova ideia jamais voltar\xe1 ao seu tamanho original.\\" - Albert Einstein\\n\\n\\n![Gatinho Soco](./giphy.gif)"}]}}')}}]);